import React from "react";
import { useParams } from "react-router-dom";


function Resume() {
    let {profile} = useParams()
    return (
        <>
            <img width={404} height={500} src={`./data/${profile}/${profile}.jpg`}/>
        </>
    );
};

export default Resume;
